webpackJsonp([0xaafa814a8aca],{613:function(e,t){e.exports={data:{site:{siteMetadata:{githubRepo:"https://github.com/esttorhe/esttorhe.github.io",author:"Esteban Torres"}},markdownRemark:{frontmatter:{title:"Xcode Plugins I use",issueNumber:18,categories:["productivity","tools","ide"],tags:["xcode","plugins","ide","developer tools"],author:null,date:"2015-07-20T11:23:40.000Z"},html:'<p>Everyone of us have our own set of niks &#x26; tricks to better find our ways around our everyday activities.</p>\n<p>For us developers that means tweaking our environment to quickly achieve what we want with the least amount of key strokes and (at the least for the most of us) without having to actually use the mouse/trackpad.</p>\n<h1 id="xcode-plugins"><a href="#xcode-plugins" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="language-text">Xcode</code> Plugins</h1>\n<p>For those out there that are familiar with plugins; go ahead and jump over to the next section, for the rest of you welcome to heaven.</p>\n<p>Plugins are 3rd Party pieces of code that can be «injected» into Xcode\'s life cycle and can extend its functionalities or even add new ones.</p>\n<p>There\'s plenty of plugins and many different ways to load/install them but my go-to way is always <a href="http://alcatraz.io/"><code class="language-text">Alcatraz</code></a>.</p>\n<!--more-->\n<h2 id="alcatraz"><a href="#alcatraz" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><a href="http://alcatraz.io/">Alcatraz</a></h2>\n<p><img src="http://alcatraz.io/images/screenshot@2x.png"></p>\n<p>From their website:</p>\n<blockquote>\n<p>Alcatraz is an open-source package manager for Xcode. It lets you discover and install plugins, templates and color schemes without the need for manually cloning or copying files. It installs itself as a part of Xcode and it feels like home.</p>\n</blockquote>\n<p>Think of it as the «AppStore» for <code class="language-text">Xcode</code> Plugins.</p>\n<p>You can easily search through a bunch of plugins and with a single click «install» them to your <code class="language-text">Xcode</code> instance to better improve your coding experience.</p>\n<h1 id="my-current-set"><a href="#my-current-set" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>My current set</h1>\n<p>The other day talking with some people on <a href="https://cocoaheadscr.herokuapp.com/"><code class="language-text">CocoaHeads CR</code></a> I was asked if I knew about some good plugins for <code class="language-text">Xcode</code>… and boy… did I 💣💥 the channel with a bunch.</p>\n<p>And while doing so I thought about writing a blog post with my current plugin set and why I do have/use them.</p>\n<p>Without further ado here\'s my list of plugins:</p>\n<table>\n<thead>\n<tr>\n<th align="left"><em>Plugin Name</em></th>\n<th align="center"><img src="/2015-07-20-Xcode-Plugins/github_logo.png" alt="github"></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align="left"><a href="#BBUDebuggerTuckAway">BBUDebuggerTuckAway</a></td>\n<td align="center"><a href="https://github.com/neonichu/BBUDebuggerTuckAway">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#RSImageOptimPlugin">RSImageOptimPlugin</a></td>\n<td align="center"><a href="https://github.com/yeahdongcn/RSImageOptimPlugin">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#CodePilot">CodePilot</a></td>\n<td align="center"><a href="https://github.com/macoscope/CodePilot">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#DerivedData-Exterminator">DerivedData Exterminator</a>\n \n \n \n \n \n </td>\n<td align="center"><a href="https://github.com/kattrali/deriveddata-exterminator">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#Polychromatic">Polychromatic</a></td>\n<td align="center"><a href="https://github.com/kolinkrewinkel/Polychromatic">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#SCXcodeSwitchExpander">SCXcodeSwitchExpander</a></td>\n<td align="center"><a href="https://github.com/stefanceriu/SCXcodeSwitchExpander">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#Snapshots">Snapshots</a></td>\n<td align="center"><a href="https://github.com/orta/Snapshots">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#VVDocumenter-Xcode">VVDocumenter-Xcode</a></td>\n<td align="center"><a href="https://github.com/onevcat/VVDocumenter-Xcode">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#XAlign">XAlign</a></td>\n<td align="center"><a href="https://github.com/qfish/XAlign">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#XcodeColors">XcodeColors</a></td>\n<td align="center"><a href="https://github.com/robbiehanson/XcodeColors">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#XcodeExplorer">XcodeExplorer</a></td>\n<td align="center"><a href="https://github.com/edwardaux/XcodeExplorer">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#XVim">XVim</a></td>\n<td align="center"><a href="https://github.com/XVimProject/XVim">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#ColorSense-for-Xcode">ColorSense-for-Xcode</a></td>\n<td align="center"><a href="https://github.com/omz/ColorSense-for-Xcode">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#Fuzzy-Autocomplete">Fuzzy Autocomplete</a></td>\n<td align="center"><a href="https://github.com/FuzzyAutocomplete/FuzzyAutocompletePlugin">Source</a></td>\n</tr>\n<tr>\n<td align="left"><a href="#KSImageNamed-Xcode">KSImageNamed-Xcode</a></td>\n<td align="center"><a href="https://github.com/ksuther/KSImageNamed-Xcode">Source</a></td>\n</tr>\n</tbody>\n</table>\n<hr>\n<h2 id="bbudebuggertuckaway"><a href="#bbudebuggertuckaway" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>BBUDebuggerTuckAway</h2>\n<p><img src="https://github.com/neonichu/BBUDebuggerTuckAway/raw/master/plugin.gif"></p>\n<blockquote>\n<p>BBUDebuggerTuckAway - Xcode plugin for auto-hiding the debugger once you start typing in the source code editor.</p>\n</blockquote>\n<p>Pretty self explanatory. Before I started using «behavior» on <code class="language-text">Xcode</code> having to show/hide the debugger between runs and debugging sessions was a PITA and this plugin came in like sent from the heaven.</p>\n<p>Now I barely take advantage of it due to the behaviors but is sill on my top 10.</p>\n<hr>\n<h2 id="rsimageoptimplugin"><a href="#rsimageoptimplugin" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><a href="https://github.com/yeahdongcn/RSImageOptimPlugin">RSImageOptimPlugin</a></h2>\n<p><img src="https://raw.githubusercontent.com/yeahdongcn/RSImageOptimPlugin/master/RSImageOptimPlugin-screenshot@2x.png"></p>\n<blockquote>\n<p>Xcode plugin to optimize images using <a href="https://github.com/pornel/ImageOptim"><code class="language-text">ImageOptim</code></a>.</p>\n</blockquote>\n<p>This plugin allows you to automatically (or manually if you are some sort of caveman… jk) optimize your image assets via <a href="https://github.com/pornel/ImageOptim"><code class="language-text">ImageOptim</code></a> helping you reduce your app\'s bundle size.</p>\n<hr>\n<h2 id="codepilot"><a href="#codepilot" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>CodePilot</h2>\n<p><img src="https://github.com/macoscope/CodePilot/raw/master/Screenshots/CodePilot_01.png"></p>\n<blockquote>\n<p>Code Pilot is a plugin for Xcode 5 &#x26; 6 that allows you to quickly find files, methods and symbols within your project without the need for your mouse. It uses fuzzy query matching to compute a list of results sorted by their relevancy. With just a few keystrokes you can jump to the method you\'re looking for.</p>\n</blockquote>\n<p>I don\'t think there\'s much to add to the story. Since I started using it, it became a <em>MAJOR</em> part of my everyday development.</p>\n<p>I can quickly navigate through HUGE codebases without effort or actually thinking about the underlying «groups» structure.</p>\n<hr>\n<h2 id="deriveddata-exterminator"><a href="#deriveddata-exterminator" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>DerivedData Exterminator</h2>\n<p><img src="https://github.com/kattrali/deriveddata-exterminator/raw/master/docs/menu.png"></p>\n<blockquote>\n<p>Sometimes Xcode needs a friendly helping hand with cleaning out the Derived Data for a project. The Exterminator makes this quick and easy.</p>\n</blockquote>\n<p>We\'ve all been at that point in life where <code class="language-text">Xcode</code> simply decides to stop giving a crap about the compiling and correct construction of our bundles. Compile warnings, pieces of code we have 💥 nuked into oblivion are giving compile errors and some beheviors we have ensured are no longer present in our code are happening when running on the simulator… :/ and who is to blame? ¯\\_(ツ)_/¯ none other than <code class="language-text">Derived Data</code> folders with stale files…</p>\n<hr>\n<p><a href="https://github.com/kattrali/deriveddata-exterminator">DerivedData Exterminator</a> is a handy plugin that lets you nuke the <code class="language-text">Derived Data</code> folder all to hell 🔥 with the click of a button <img src="https://github.com/kattrali/deriveddata-exterminator/raw/master/docs/exterminator.png"></p>\n<p>Or via the menu option shown at the top of this section.</p>\n<p>I can\'t stress enough how handy this plugin is to my everyday compiling and debugging activities.</p>\n<hr>\n<h2 id="polychromatic"><a href="#polychromatic" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Polychromatic</h2>\n<p><img src="https://camo.githubusercontent.com/116fe74b35b6a719e94b42118b2a531731957cf2/68747470733a2f2f66696c65732e6170702e6e65742f3230776c6e682d44472e706e67"></p>\n<blockquote>\n<p>Coloring with significance.</p>\n<p>Polychromatic is an Xcode plugin that makes code logic clear and apparent. It gives properties, ivars, and local variables each a unique, dynamic color, stripping away emphasis from types which don\'t need it.</p>\n</blockquote>\n<p>A great plugin for visual identification of scoped pieces of data. With a quick glance you can infer if an «artifact» you are using belongs to the local context or a more global one given its color.</p>\n<p>Is no secret that sometimes we call local scoped vars the same name as some global scoped ones; with this plugin you can easily identify which is which (and please as soon as you realize this for the love of Google Christ change the names of the local ones to help differentiation more).</p>\n<hr>\n<h2 id="scxcodeswitchexpander"><a href="#scxcodeswitchexpander" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>SCXcodeSwitchExpander</h2>\n<p><img src="https://camo.githubusercontent.com/d4ab3ba45af70951557adbf17a9d0deab47e519f/68747470733a2f2f646c2e64726f70626f7875736572636f6e74656e742e636f6d2f752f31323734383230312f534358636f6465537769746368457870616e6465722f534358636f6465537769746368457870616e646572312e676966"></p>\n<blockquote>\n<p>SCXcodeSwitchExpander is a small Xcode plugin that expands switch statements by inserting missing cases.</p>\n</blockquote>\n<p>Is just so simple to miss some cases when switching over an enumerator or so time consuming to have to go to the <code class="language-text">enum</code> definition and check all possible <code class="language-text">case</code>s or worst; copying the whole <code class="language-text">enum</code> definition, pasting it inside the <code class="language-text">switch</code> and then correctly changing the syntax to match…</p>\n<p>Well this is super easy; just write <code class="language-text">switch</code>, insert the var name and hit <code class="language-text">Enter</code> and the plugin will «automagically» generate all possible <code class="language-text">cases</code> for you.</p>\n<p>Simple and clean.</p>\n<p>On a personal note I haven\'t been able to test it on <code class="language-text">Swift</code> but for those sad times when I\'m writing <code class="language-text">Objective-C</code> its quite handy.</p>\n<hr>\n<h2 id="snapshots"><a href="#snapshots" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Snapshots</h2>\n<p><img src="https://raw.githubusercontent.com/orta/Snapshots/master/web/screenshot.jpg"></p>\n<blockquote>\n<p>Features</p>\n<ul>\n<li>Showing new images as they\'re created</li>\n<li>Showing the differences between failed snapshot tests</li>\n<li>Open specific diffs in Kaleidoscope</li>\n<li>Turns red if you\'ve created a view with a zero frame</li>\n</ul>\n</blockquote>\n<p>If you are not doing <a href="https://github.com/facebook/ios-snapshot-test-case"><code class="language-text">view testing</code></a> you should definitely check that link out and start adding that to your unit tests.</p>\n<p>If you are already doing <a href="https://github.com/facebook/ios-snapshot-test-case"><code class="language-text">view testing</code></a> then you are in for a treat with this plugin. Directly from <code class="language-text">Xcode</code> you can check which views are failing the tests and even do a live comparison of the recorded and live views to check where\'s the discrepancy; and if you have <a href="http://www.kaleidoscopeapp.com/"><code class="language-text">Kaleidoscope</code></a> installed it will generate a «command line» command to open up the <code class="language-text">diff</code> on the app.</p>\n<hr>\n<h2 id="vvdocumenter-xcode"><a href="#vvdocumenter-xcode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>VVDocumenter-Xcode</h2>\n<p><img src="https://camo.githubusercontent.com/ca5518c9872e15b8a95b9d8c5f44bc331977d710/68747470733a2f2f7261772e6769746875622e636f6d2f6f6e65766361742f5656446f63756d656e7465722d58636f64652f6d61737465722f53637265656e53686f742e676966"></p>\n<blockquote>\n<p>…you can find the method (or any code) you want to document to, and type in <code class="language-text">///</code>, the document will be generated for you and all params and return will be extracted into a Javadoc style, which is compatible with <a href="https://github.com/tomaz/appledoc">appledoc</a>, <a href="http://www.stack.nl/~dimitri/doxygen/">Doxygen</a> and <a href="https://developer.apple.com/library/mac/documentation/DeveloperTools/Conceptual/HeaderDoc/intro/intro.html">HeaderDoc</a>. You can just fill the inline placeholder tokens to finish your document.</p>\n</blockquote>\n<p>If you know me you\'ll know I\'m a sucker for internal documentation (more so if they are going to be beautifully rendered in something like <a href="http://cocoadocs.org">CocoaDocs</a>).</p>\n<p>This plugin will get you started by bootstrapping a header doc template over functions with placeholders for the parameters and returns as well as description. You only need to type <code class="language-text">///</code> and ⚡ you are ready!</p>\n<hr>\n<h2 id="xalign"><a href="#xalign" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>XAlign</h2>\n<p><img src="https://camo.githubusercontent.com/7973c0e352b1f91e3efe5b3550cff5df97f4589a/687474703a2f2f7166692e73682f58416c69676e2f696d616765732f657175616c2e676966"></p>\n<blockquote>\n<p>An amazing Xcode plugin to align regular code. It can align anything by using custom alignment patterns.</p>\n</blockquote>\n<p>Aside from being a sucker for documentation I have a special place in my ❤ for unit testing and nicely organized code.</p>\n<p>Enter <a href="https://github.com/qfish/XAlign">XAlign</a> and my <code class="language-text">OCD</code> kicks in allowing me to neatly organize all properties, assignments and whatever I feel like needs alignment.</p>\n<hr>\n<h2 id="xcodecolors"><a href="#xcodecolors" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>XcodeColors</h2>\n<blockquote>\n<p>XcodeColors allows you to use colors in the Xcode debugging console.\nIt\'s designed to aid in the debugging process.\nI use this along with a custom logger with <a href="https://github.com/CocoaLumberjack/CocoaLumberjack">CocoaLumberjack</a> to easily know when something being logged into the console is a debugging statement, a warning or even <em>worst</em> an error.</p>\n</blockquote>\n<p>Assigning colors to each level is the best way to easily check when something goes eerie on your code.</p>\n<p>We tend to <code class="language-text">DDLogError</code> everywhere we «expect» an error from any <code class="language-text">API</code> calls and some <code class="language-text">DDLogDebug</code> here and there while developing (depending on your logging level the only output that will be visible on your production apps will be what you want and nothing more).</p>\n<hr>\n<h2 id="xcodeexplorer"><a href="#xcodeexplorer" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>XcodeExplorer</h2>\n<blockquote>\n<p>This is a plugin project that allows you, as a developer, to explore the various events and notifications that Xcode4 emits during normal operations.</p>\n</blockquote>\n<p>Since we are talking plugins here; why not have a plugin that helps you build your own plugins? Meta much?</p>\n<p>Well; this plugin is exactly that. It will let you listen and identify different notifications that <code class="language-text">Xcode</code> fires during its normal process; giving you the knowledge to easily intercept something you are interested on and gives you the power to shape it to your own needs.</p>\n<p>I have played with this for a plugin I started last year that never got enough time to pour the love it needs to become a real world plugin. Maybe one of this days it will see the light.</p>\n<hr>\n<h2 id="xvim"><a href="#xvim" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>XVim</h2>\n<blockquote>\n<p>XVim is a Vim plugin for Xcode. The plugin intends to offer a compelling Vim experience without the need to give up any Xcode features.</p>\n</blockquote>\n<p>Given the fact that I\'m a dork and like the «limitations» the <code class="language-text">vim</code> imposes upon you this plugin gives me those but inside <code class="language-text">Xcode</code>; letting my nerd burst without sacrificing the power of a real world <code class="language-text">IDE</code>.</p>\n<hr>\n<h2 id="colorsense-for-xcode"><a href="#colorsense-for-xcode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>ColorSense-for-Xcode</h2>\n<iframe width="560" height="315" src="https://www.youtube.com/embed/eblRfDQM0Go" frameborder="0" allowfullscreen></iframe>\n>This is where ColorSense comes in: When you put the caret on one of your colors, it automatically shows the actual color as an overlay, and you can even adjust it on-the-fly with the standard Mac OS X color picker.\n<p>I guess you can see the benefit of this one.</p>\n<hr>\n<h2 id="fuzzy-autocomplete"><a href="#fuzzy-autocomplete" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Fuzzy Autocomplete</h2>\n<p><img src="https://github.com/FuzzyAutocomplete/FuzzyAutocompletePlugin/raw/master/demo.gif"></p>\n<blockquote>\n<p>This is a Xcode 5+ plugin that patches the autocomplete filter to work the same way the Open Quickly works. It performs extremely well, and the fuzzy matching actually uses Xcode\'s own <code class="language-text">IDEOpenQuicklyPattern</code>.</p>\n</blockquote>\n<p>Who doesn\'t love fuzzy autocomplete when writing code!? ¯\\_(ツ)_/¯</p>\n<p>I know the description says <code class="language-text">Xcode 5+</code> which makes it sound like a dead project but you can check the source and see that is actively developed and also <code class="language-text">Xcode 7</code> is mostly supported so far; even though is still ß.</p>\n<hr>\n<h2 id="ksimagenamed-xcode"><a href="#ksimagenamed-xcode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>KSImageNamed-Xcode</h2>\n<p><img src="https://camo.githubusercontent.com/c354bf04524df86daeabe7a6d2b9926fac790f85/68747470733a2f2f7261772e6769746875622e636f6d2f6b7375746865722f4b53496d6167654e616d65642d58636f64652f6d61737465722f73637265656e73686f742e676966"></p>\n<blockquote>\n<p>Can\'t remember whether that image you just added to the project was called button-separator-left or button-left-separator? Now you don\'t have to, because this will autocomplete your imageNamed: calls like you\'d expect. Just type in <code class="language-text">[NSImage imageNamed:</code> or <code class="language-text">[UIImage imageNamed:</code> and all the images in your project will conveniently appear in the autocomplete menu. You\'ll even get a handy preview of the image you\'re about to select.</p>\n</blockquote>\n<p>GREAT way to find your image assets :D</p>\n<p>Would ❤ to see Olivier\'s <a href="https://github.com/AliSoftware/SwiftGen"><code class="language-text">SwiftGen</code></a> as a plugin though :D</p>',url:"Xcode-Plugins"}},pathContext:{id:"/home/travis/build/esttorhe/esttorhe.github.io/content/_posts/2015-07-20-Xcode-Plugins/2015-07-20-Xcode-Plugins.markdown absPath of file >>> MarkdownRemark"}}}});
